import React from "react";
import classes from "./Dialogs.module.css";
import {NavLink} from "react-router-dom";

const DialogItem = () => {
    return (
        <NavLink to="/dialogs/1" className={classes.dialog_item + ' ' + classes.active}>
            Roman
        </NavLink>
    )
}

const Dialogs = (props) => {
    return(
        <div className={classes.dialogs}>
            <div className={classes.dialogs_items}>
                <DialogItem/>
                <NavLink to="/dialogs/2" className={classes.dialog_item}>
                    Daniel
                </NavLink>
                <NavLink to="/dialogs/3" className={classes.dialog_item}>
                    Max
                </NavLink>
            </div>
            <div className={classes.messages}>
                <div className={classes.message_item}>
                    Hi!!!
                </div>
                <div className={classes.message_item}>
                    When will u connect Mongo to your shop Homie__)))
                </div>
                <div className={classes.message_item}>
                    AHAHAHH
                </div>
            </div>
        </div>
    )
}

export default Dialogs;
